import React from 'react'
import { StyleSheet, View } from 'react-native'

const Login = () => {
    return (
        <View style={Styles.container}>
            <View style={Styles.containerAfter}></View>
            <View style={Styles.containerBefore}></View>
        </View>
    )
}

const Styles = StyleSheet.create({
    container: {
        width: 80,
        height: 100,
        justifyContent: 'center',
        alignSelf: 'center'
      },
      containerBefore: {
        position: 'absolute',
        top: 0,
        left: 0,
        width: 0,
        height: 0,
        borderWidth: 20,
        borderColor: 'red',
        borderStyle: 'solid',
        borderTopLeftRadius: 50,
        borderTopRightRadius: 50,
        borderBottomRightRadius: 50,
        borderBottomLeftRadius: 0,
        transform: [
          {rotate: '-135deg'}
        ]
      },
      containerAfter: {
        position: 'absolute',
        top: 0,
        right: 0,
        width: 0,
        height: 0,
        borderWidth: 20,
        borderColor: 'red',
        borderStyle: 'solid',
        borderTopLeftRadius: 50,
        borderTopRightRadius: 0,
        borderBottomRightRadius: 50,
        borderBottomLeftRadius: 50,
        transform: [
          {rotate: '-135deg'}
        ]
      }
})

export default Login
